<?phpnamespace Nemundo\Content\Index\Tree\Install;use Nemundo\App\Application\Setup\ApplicationSetup;use Nemundo\App\Application\Type\Install\AbstractInstall;use Nemundo\App\WebService\Setup\ServiceRequestSetup;use Nemundo\Content\Action\Setup\ActionSetup;use Nemundo\Content\Index\Tree\Action\ChildOrder\ChildOrderAction;use Nemundo\Content\Index\Tree\Action\TreeAction;use Nemundo\Content\Index\Tree\Action\ViewChange\ViewChangeAction;use Nemundo\Content\Index\Tree\Application\TreeApplication;use Nemundo\Content\Index\Tree\Data\TreeModelCollection;use Nemundo\Content\Index\Tree\Service\BreadcrumbService;use Nemundo\Content\Index\Tree\Service\ParentTreeSearchService;use Nemundo\Content\Index\Tree\Service\TreeDeleteService;use Nemundo\Content\Index\Tree\Service\TreePostService;use Nemundo\Content\Index\Tree\Service\ChildTreeSearchService;use Nemundo\Model\Setup\ModelCollectionSetup;class TreeInstall extends AbstractInstall{    public function install()    {        (new ApplicationSetup())->addApplication(new TreeApplication());        (new ModelCollectionSetup())->addCollection(new TreeModelCollection());        (new ActionSetup())            ->addContentAction(new TreeAction())            ->addContentAction(new ChildOrderAction())            ->addContentAction(new ViewChangeAction());        (new ServiceRequestSetup(new TreeApplication()))            ->addService(new TreePostService())            ->addService(new TreeDeleteService())            ->addService(new BreadcrumbService())            ->addService(new ParentTreeSearchService())            ->addService(new ChildTreeSearchService());    }}